import { func } from 'prop-types'
import React from 'react'
import { Card, ListGroup, ListGroupItem } from 'react-bootstrap'
const custom_style = { backgroundColor: "#fafafa"};
function JobDetailsFloatComponent(userDetails) {
    return (
        <div class="Card">
                <div className="JobsCardComponent_divider">
                    <div className="JobsCardComponent_divider_first">
                        <Card.Img variant="top" src={userDetails.userProfilePicture} />
                        <Card.Title>{userDetails.userName}</Card.Title>
                    </div>
                    <div className="JobsCardComponent_divider_second">
                      
                        <Card.Text>{userDetails.userTitle}</Card.Text>
                       
                    </div>
                </div>


            </div>
    )
}

export default JobDetailsFloatComponent;
